import React from "react";
import { Row, Col, Input, Modal, Typography } from "antd";

const { Text } = Typography;
const CustomModal = ({ visible, onSubmit, onCancel, data }) => {
  return (
    <Modal
      title="Edit info"
      visible={visible}
      onOk={onSubmit}
      onCancel={onCancel}
    >
      {data === null
        ? console.log("error")
        : console.log(
            "Modal",
            data.map(d => d.name)
          )}
    </Modal>
  );
};

export default CustomModal;
